interface APYArcProps {
  variant: '0-3' | '3-6' | '6-9' | '12+',
  children : ReactNode
}
const APYArc: FC<APYArcProps> = ({
  variant,
  children
}) => {

  const [showApyPopup, setShowApyPopup] = useState(false);

  return (
    <>
      {
        variant === '0-3' &&
        <APYArc0_3 />
      }
      {
        variant === '3-6' &&
        <APYArc3_6 />
      }
      {
        variant === '6-9' &&
        <APYArc6_9 />
      }
      {
        variant === '12+' &&
        <APYArc12 />
      }
      <div
        className="flex items-center justify-center gap-1 -mt-6 cursor-pointer"
        onClick={() => setShowApyPopup(true)}
      >
        <div
          className="text-body-s-strong text-default"
        >
          Expected APY breakdown
        </div>

        <LucideChevronDown
          size={16}
          className="text-foreground-weakest"
        />
      </div>
      {
        showApyPopup &&
        <div
          className="absolute flex flex-col justify-end h-full w-full p-6 bg-linear backdrop-blur-lg top-0 left-0"
        >
          <div className="flex justify-between text-foreground-weak text-md font-medium mb-3">
            Expected APY breakdown

            <LucideX
              onClick={() => setShowApyPopup(false)}
              className="cursor-pointer text-dimmed"
              size={16}
            />
          </div>

          {children}
        </div>
      }
    </>
  )
}

export default APYArc;